import React, { Component } from 'react'

export default class Tour extends Component {
    render() {
        return (
            <article className="tour">
                <div className="img-container">

               <img width="200px" src="https://player.vimeo.com/external/354645621.sd.mp4?s=69d6828f9ee9b66b0eafa9a41d60a537c51fb81a&profile_id=139&oauth2_token_id=57447761" alt="">
               </img>

                </div>
            </article>
        )
    }
}
